  false,\n\t\"url\": null,\n\t\"notes\": \"USGS Contract: G10PC00026 Task Order Number:
  G10PD02126 LiDAR was collected at a 2.0 meter nominal post spacing (2.0m GSD) for
  approximately 329 square miles of Baldwin County, Alabama, while no snow was on
  the ground and rivers were at or below normal levels. Project was divided into two
  separate AOIs, Baldwin West and Baldwin East. Project meets U.S. Geological Survey
  National Geospatial Program Base LiDAR Specification, Version 13. LAS Classifications:
  Class 1: Unclassified Class 2: Bare Earth Ground Class 5: High Vegetation Class
  7: Noise (Low points) Class 9: Water Class 10: Ignored Ground (within 1m of breakline)
  Class 12: Overlap Class 13: Witheld\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
